		  <h3 class=""title"">Library <span class=""color-secondary""></span></h3>
		  <span class=""shape-line""><i class=""icon-19""></i></span>


		  <p>Libraries are the backbone of any civilized and culturally enriched society and they form the core of any academic institution. The library at Pioneer Montessori Inter College houses varied kinds of books of diversified fields and subjects. International journals and online magazines on most sought after subjects are available for academic and research activities. </p>

		  <p>The Library has huge collection of literary books such novels, plays, fiction short stories etc. to supplement students with necessary creativity and inculcate an art of innovation in them. The Library has adequate reference books on each of subject prescribed in the syllabus so that students may have rich study material for their respective examinations.</p>");
            WriteLiteral(@"

		  <p>A library is a collection of sources, resources, and services, and the structure in which it is housed; it is organized for use and maintained by a public body, an institution, or a private individual. In the more traditional sense, a library is a collection of books .It can mean the collection, the building or room that houses such a collection, or both.</p>

		  <p>The term ""library"" has itself acquired a secondary meaning: ""a collection of useful material for common use."" This sense is used in fields such as computer science, mathematics, statistics, electronics and biology. It can also be used by publishers in naming series of related books, e.g. The Library of Anglo-Catholic Theology. Libraries often provide a place of silence for studying.</p>

